import React, { useState } from 'react';
import IC1 from './images/IC1.jpg';
// import IC2 from './images/IC2.jpg';
// import IC4 from './images/IC4.jpg';
import IC3 from './images/IC3.jpg';
import IC5 from './images/IC5.jpg';
import IC6 from './images/IC6.jpg';

function Footer() {
  const imageFiles = [IC1, IC3, IC5, IC6];
  return (
    <div className="flex w-10 p-6 h-auto">
        {imageFiles.map((image, i) => 
          <img key={i} src={image} alt="image" />
        )}
     </div>
)
}
export default Footer;
